import RoadContent from "./RoadContent";

let func = {
    MoveRoad: function(roadContent)
    {
        let now = new Date();
        console.log("Function MoveRoad called at "
            + now.getHours() + ":"
            + now.getMinutes() + ":"
            + now.getSeconds())
        let array = roadContent.content;
        array.shift();
        array[array.length] = Math.floor(Math.random() * 3);
        return new RoadContent(array)
    }
}
export default func
